import './style.css';
import './responsive.css';
import Header from './components/Header';
import Register from './components/Register';
import { BrowserRouter as Router,Routes} from "react-router-dom"; 
function App() {
  return (
    <div className="App">
      <Router>
        <Header/>
        <Routes>
        <Route   path ="/" element={<Register/>}/>
        </Routes>
      </Router>

    </div>
  );
}
export default App;
